Dorsum granulated (
Fig. 2
); flanks finely granular; venter smooth; forelimb relatively slender. Forearm length subequal to brachial length (BL/FAL = 103.9%); fingers long and slender, without webbing; Fin1L/Fin2L = 103.8%, Fin1L/ Fin4L = 86.5%, Finger III longest; fingertips slightly expanded into rounded disc, circummarginal groove present; disc width of finger wider than width of terminal phalanx of finger: Fin1DW/Fin1TPW = 142.9%, Fin2DW/Fin2TPW = Fin3DW/Fin3TPW = Fin4DW/Fin4TPW = 128.6%; subarticular tubercles present, round, raised prominently; one subarticular tubercle on Finger I and II, two on Finger III and IV; supernumerary tubercles between the base of each finger and subarticular tubercle present, smaller and less prominent than subarticular tubercles, translucent; outer metacarpal tubercle and palmar tubercle distinct, elongate (OMCL/OMCW = 254.5%, PTL/PTW = 227.3%), in contact, not prominent, subequal in length and width (OMCL/PTL = 112.0%, OMCW/PTW = 100.0%); inner metacarpal tubercle oval, prominent, slightly longer than outer metacarpal tubercle and palmar tubercle (IMCL/OMCL = 107.1%; IMCL/PTL = 120.0%).

Natural history. The new species is currently known only from primary forest. All Aceh specimens were collected from within protected areas (Taman Nasional Gunung Leuser, Taman Buru Linge Isaq, and local protected forest in Mane). The holotype was first observed calling from among leaf litter, under low vegetation, about 2.5 m from a small stream ( 2–3 m width). Two of the paratypes (MZB.Amph.28890 and MZB.Amph.28898) and three juveniles (referenced specimens: MZB.Amph.28889, MZB.Amph.28943, MZB. Amph.28948) were collected the same night at the type locality. MZB.Amph.28889 was perched on a fern growing over above dead log, approximately 1.0 m from a nearby stream at 2038 hours. MZB.Amph.28890 was perched on a dead branch in a stream, approximately 5 cm above the surface of the water at 2145 hours. MZB.Amph.28898 was encountered at 2048 hours on a dead log (d = 30 cm ), approximately 1.2 m from the stream. MZB.Amph.28943 was caught seated on an orchid leaf, on the forest floor at 2036 hours. MZB.Amph.28948 was collected at 2036 hours from an orchid leaf, approximately 10 cm above the ground. At the time, the nearby stream was narrower than its usual width, due to low seasonal precipitation. Other species recorded in the same vicinity included one species of ranid frog (
Huia sumatrana
), two species of colubrid snakes (
Boiga nigriceps
and
B. jaspidea
), one species of scincid lizard (
Eutropis sp.
), and orangutans (
Pongo abelii
). The forest type was a typical lowland dipterocap forest. The four remaining paratypes (MZB.Amph.28892, MZB. Amph.28894, MZB.Amph.28896, and MZB.Amph.28944) were collected in the same region, but at higher elevation ( 1,000 m ). The stream at this elevation was surrounded by primary forest, and was approximately 5–6 m wide. Large rocks were prevalent and the stream water was silty and red in colour. The resting perches of collected animals included rocks, dead logs, and roots. Pictures of habitat for this species are provided ( Fig. 3b, c ).
